fxList._virtualQueryString:
function (source, callback) {

    var copy = _.extend({}, source);
    copy.columns.push('fxLower');
    copy.meta['fxLower'] = 9;

    _.each(copy.rows, function(r){
      r.fxLower = r.fx.toLowerCase();
    });


    callback(copy);

}

MenuVs._virtualQueryString:
function (source, callback) {

  var hash = window.location.hash;
  _.each(source.rows, function(r,i){
	  if(r.url === hash){
				 r.color = '#FFFFFF';
		}		
	});   
  callback(source);

}
